import {
    GET_ENTRY_DATA,
    GET_ENTRY_DATA_SUCCESS,
    GET_ENTRY_DATA_ERROR
  } from "./actionTypes"

  const INIT_STATE = {
    resp: {},
    error: {},
  }

  const entrydata = (state = INIT_STATE, action) => {
    switch (action.type) {
      case GET_ENTRY_DATA_SUCCESS:
        return {
          ...state,
          resp: action.payload,
        }
  
      case GET_ENTRY_DATA_ERROR:
        return {
          ...state,
          error: action.payload,
        }
  
      default:
        return state
    }
  }
  
  export default entrydata
